iOS IGListKit-top模型
一般在写 IG 的模型的时候, 会有一个 top model , top model 里面又有个 datalist, 
datalist 一般是个数组, 里面存放了列表的数据.
top model 也需要遵循 IGListDiffable 协议.
一般 top Model 的协议方法我们照着下面这样写:
- (nonnull id )diffIdentifier {
  return self;
}

- (BOOL)isEqualToDiffableObject:(nullable id )other {
  // YES 表示相等 , 不更新 即便 0 != 1 , 手动告诉diff算法 这是相等的
  return YES;
}

topModel 里面的 datalist 模型也需要实现 IGListDiffable 协议, 否则 diff 算法不起作用.
datalist 里面的模型的协议方法如下写:
- (nonnull id )diffIdentifier {
  // list bind section controller  一个section 带 n 个 item
  // SNUserModel 和 每一个 item 绑定 , 因此根据 diff算法的协议, 必须得有唯一的标识符
  // 如果是 一个模型 绑定一个 section的话 , 唯一标识符 重复了也没事 , 因为 section controller 只关心 一个 section,
  //
  return self.withdrawId;
}

- (BOOL)isEqualToDiffableObject:(nullable id )other {
  if (!other) { return NO; }
  if (self == other) { return YES; }
  YJTradeWithdrawModel *model = (YJTradeWithdrawModel *) other;
  return
    [self.userId isEqualToString:model.userId] &&
    [self.amount isEqualToString:model.amount] &&
    [self.insertTime isEqualToString:model.insertTime] &&
    [self.wxhbpws isEqualToString:model.wxhbpws] &&
    [self.hbsendtime isEqualToString:model.hbsendtime] &&
    self.status == model.status &&
    self.hbStatus == model.hbStatus;
}

Swift/Swift @escaping & @nonescaping.htm.body:
Swift @escaping & @nonescaping
Swift 中的闭包经常会被编译器提示加上 @escaping 关键字, 不知道你有没有想过为什么要加上这个呢?
结论: 如果闭包是异步执行,需要加上 @escaping 关键字, 如果是在方法执行完毕之前执行的闭包, 就无需加上 @escaping 关键字.
解释:在方法中的闭包经常会出现这样一个场景, 比如一个网络请求 RequestApi 的回调闭包, 这样的闭包通常都是异步执行的, 等待接收到服务器的响应后, 再去执行闭包, 这时, 这个闭包是在 RequestApi 方法执行完毕后, 再去执行的, 这时, 我们可以看做这个闭包已经逃离了 RequestApi.比如下面的代码:  
func slCompare(_ array:[T], handler: @escaping (T, T) -> Bool) {
  DispatchQueue.main.async {
    if handler(array[0], array[1]) {
      print("大于")
    } else {
      print("小于")
    }
  }

  print(array)
}


slCompare(a) { (a, b) -> Bool in
  return a 
我们专门用了 GCD 的一个异步队列去执行这个闭包, 这个 handler 就必须加上 @escaping
如果我们去掉了 DispatchQueue.main.async {} 那么这个闭包就是跟随方法一起执行的, 而不是等待方法执行结束后, 再执行.
跟方法一起执行, 也就是跟方法同生共死的闭包, 就是非逃逸闭包, 不需要加上 @escaping.
生命周期:@nonescaping closures  

    当函数调用的时候, 闭包当做函数参数传递给函数
    和函数一起做一些额外的工作
